"original": |2-
     First ACK Range:  A variable-length integer indicating the number of
        contiguous packets preceding the Largest Acknowledged that are
        being acknowledged.  That is, the smallest packet acknowledged in
        the range is determined by subtracting the First ACK Range value
        from the Largest Acknowledged field.
"fixed": |-
  First ACK Range:  A variable-length integer indicating the number of contiguous packets preceding the Largest Acknowledged that are being acknowledged.  That is, the smallest packet acknowledged in the range is determined by subtracting the First ACK Range value from the Largest Acknowledged field.
"ko": |-
  첫 번째 ACK 범위: 승인 중인 최대 승인 이전의 연속 패킷 수를 나타내는 가변 길이 정수입니다. 즉, 해당 범위에서 승인된 가장 작은 패킷은 가장 큰 승인 필드에서 첫 번째 ACK 범위 값을 빼서 결정됩니다.
